import React from 'react';

import CountryNavigation from './CountryNavigation';

export default function Country({ country }) {
	return (
		<>
			<CountryNavigation />
			<section className=" grid gap-20 grid-cols-1 md:grid-cols-2 flex-grow">
				<div className="bg-red-200 h-full w-full">
					<div className=''>
						<img src={country.flag} alt={`${country.name}'s flag`} />
					</div>
				</div>
				<div className="bg-green-200 h-full w-full"></div>
			</section>
		</>
	);
}
